import styled from 'styled-components';

export const Container = styled.div`
  background:var(--color-white);
  padding:2px;
  padding-top:10px;
  border-bottom:var(--color-border-top);




  >ul li{
    display:flex;
    justify-content:center;
    align-items:center;
  }

`;


export const IconImage  = styled.img`
   height:54px;
   width:54px;

`;
